DROP TABLE IF EXISTS `dict_area`;
CREATE TABLE `dict_area` (
  `area_code` varchar(20) NOT NULL COMMENT '城市代码',
  `area_name` varchar(45) NOT NULL COMMENT '城市名称',
  `parent` varchar(20) DEFAULT NULL,
  `short_name` varchar(15) DEFAULT NULL,
  `longitude` float NOT NULL DEFAULT '0' COMMENT '经度',
  `latitude` float NOT NULL DEFAULT '0' COMMENT '纬度',
