  `level` int(2) NOT NULL DEFAULT '1',
  `sort` int(5) NOT NULL,
  `is_leaf` tinyint(1) NOT NULL DEFAULT '0',
  `is_enabled` tinyint(1) NOT NULL DEFAULT '1',
  `is_valid` tinyint(1) NOT NULL DEFAULT '1',
  PRIMARY KEY (`area_code`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

